import React from 'react';
import '../styles/Navigation.css';

const Navigation = () => {
  return (
    <nav className="navbar">
      <div className="navbar-content">
        <div className="navbar-brand">
          <h2>English Grammar Quiz</h2>
        </div>
      </div>
    </nav>
  );
};

export default Navigation;
